// Components/Search.js
import React from 'react';

function Search({ searchQuery, setSearchQuery }) {
  return (
    <input
      type="text"
      placeholder="Search PDFs..."
      value={searchQuery}
      onChange={(e) => setSearchQuery(e.target.value)}
      className="search-bar"
    />
  );
}

export default Search;
